import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})

export class GlobalService {

  public user: any;
  panier: Panier = new Panier();
  public url = "https://m1p9mean-mihaja-back.herokuapp.com/";
  public config;
  constructor(private http: HttpClient) { 
    this.config = {
        image_resto: "data:image/png;base64,",
        image_plat: "data:image/png;base64,",
        frais: 4000,
        pourcentage: 0.3
    }
  }

  login(user): Observable<any> {
    return this.http.post(this.url + "login", user);
  }

  formOption (use_authorization = false, token = null) {
    const options = {
      headers: new HttpHeaders()
      .set('Authorization',  `Bearer ${token}`)
      .set('Content-Type' , 'application/json')
    };
    return options;
  }

  isLogged() {
    if(localStorage.getItem('token') == null) return false;
    return true;
  }

}

export class Panier {
  plats: Panierplats[]
  total:number
  constructor() {
    this.plats = [];
    this.total = 0;
    this.benefice_resto = 0;
  }
  date: string
  numero: string
  adresse: string
  nom: string
  restaurant: string
  etat: string;
  benefice_resto: number;
  benefice_ekaly: number;
}

export class Panierplats {
  nom: string;
  quantite: number;
  prix: number;
  montant: number;
}
